// Core logic function
export function solve(n) {
    // Ensure valid number
    if (typeof n !== 'number' || n < 0 || !Number.isInteger(n)) {
        return [0, []];
    }

    let m = n;
    let count = 0;
    let parts = [];
    let place = 1;

    while (m > 0) {
        const digit = m % 10;
        if (digit !== 0) {
            parts.push(digit * place);
            count++;
        }
        m = Math.floor(m / 10);
        place *= 10;
    }

    // Reverse to keep left-to-right order (like 4000 before 20)
    parts.reverse();

    return [count, parts];
}


