'use strict';

// ✅ Pure function: Computes king's moves from s to t
export function solve(s, t) {
    const start = s.split('');
    const end = t.split('');

    const dx = end[0].charCodeAt() - start[0].charCodeAt();
    const dy = end[1] - start[1];

    const steps = Math.max(Math.abs(dx), Math.abs(dy));
    const moves = [];

    let x = start[0].charCodeAt();
    let y = parseInt(start[1]);

    for (let i = 0; i < steps; i++) {
        let move = '';
        if (x < end[0].charCodeAt()) {
            move += 'R';
            x++;
        } else if (x > end[0].charCodeAt()) {
            move += 'L';
            x--;
        }

        if (y < end[1]) {
            move += 'U';
            y++;
        } else if (y > end[1]) {
            move += 'D';
            y--;
        }

        moves.push(move);
    }

    return {
        count: steps,
        directions: moves
    };
}

