'use strict';

// ✅ Pure function: takes an integer n and returns { count, parts[] }
export function solve(n) {
    const count = n >> 1; // Math.floor(n / 2)
    const parts = [];

    if (n % 2 === 1) {
        parts.push(3);
        n -= 3;
    }

    const twos = n / 2;
    for (let i = 0; i < twos; i++) {
        parts.push(2);
    }

    return { count, parts };
}

