'use strict';

// ✅ Pure logic function
export function solve(testCases) {
    return testCases.map(({ n, arr }) => {
        let totalTwos = arr.filter(x => x === 2).length;

        if (totalTwos === 0 || totalTwos % 2 !== 0) return -1;

        let halfTwos = totalTwos / 2;
        let seenTwos = 0;

        for (let i = 0; i < n; i++) {
            if (arr[i] === 2) {
                seenTwos++;
            }
            if (seenTwos === halfTwos) {
                return i + 1; // 1-based index
            }
        }

        return -1;
    });
}

