/**
 * Solves a set of test cases based on permutation cycles and constraints.
 * @param {Array} testCases - Array of test case objects with { N, A, B, C }
 * @returns {Array} - Array of answers for each test case.
 */
export function solve(testCases) {
    //TODO error has to fix
    const MODD = 1000000007;
    const results = [];

    for (const { N, A, B, C }
        of testCases) {
        const arrow = {};
        for (let i = 0; i < N; i++) {
            arrow[A[i]] = B[i];
        }

        const cSet = new Set();
        for (let i = 0; i < N; i++) {
            if (C[i] !== 0) cSet.add(C[i]);
        }

        const taken = new Array(N + 1).fill(false);
        const cycles = [];

        for (let i = 1; i <= N; i++) {
            if (!taken[i]) {
                const cycle = [];
                let j = i;
                while (!taken[j]) {
                    taken[j] = true;
                    cycle.push(j);
                    j = arrow[j];
                }
                cycles.push(cycle);
            }
        }

        let ans = 1;
        for (const cycle of cycles) {
            let hasFixed = false;
            for (const u of cycle) {
                if (cSet.has(u)) {
                    hasFixed = true;
                    break;
                }
            }

            if (!hasFixed && cycle.length > 1) {
                ans = (ans * 2) % MODD;
            }
        }

        results.push(ans);
    }

    return results;
}

