'use strict';

/**
 * Solve each test case: find the maximum reachable value using the described method.
 * @param {Array} testCases - Array of test cases, each with a number `n` and array `a`
 * @returns {Array<number>} - The resulting max values for each test case
 */
export function solve(testCases) {
    const results = [];

    for (const { n, a }
        of testCases) {
        const s = new Set();
        const d = new Map();
        s.add(n);
        let ans = n;
        const q = [n];

        for (let i = 0; i < n; i++) {
            let e = a[i] + i;
            if (d.has(e)) {
                d.get(e).push(i);
            } else {
                d.set(e, [i]);
            }
        }

        for (const x of q) {
            if (!d.has(x)) continue;

            for (const y of d.get(x)) {
                const val = x + y;
                if (!s.has(val)) {
                    q.push(val);
                    s.add(val);
                    ans = Math.max(ans, val);
                }
            }
        }

        results.push(ans);
    }

    return results;
}

