// Function to compute GCD (NOD)
export function gcd(...args) {
    let x = args[0];
    for (let i = 1; i < args.length; i++) {
        let y = args[i];
        while (x && y) {
            x > y ? (x %= y) : (y %= x);
        }
        x += y;
    }
    return x;
}

// Function to compute the desired result for one pair (a,b)
export function solve(a, b) {
    const n = gcd(a, b);
    let res = (a / n) * b;
    if (res === b) {
        if (a === n) {
            res *= b / n;
        } else {
            res *= 2;
        }
    }
    return res;
}

