// Core logic function for Hackerrank-style use
export function solve(n, a) {
    const stack = [];
    for (let i = 0; i < n; i++) {
        let l = 0,
            r = stack.length;
        while (l < r) {
            const m = (l + r) >> 1;
            if (stack[m] <= a[i]) {
                l = m + 1;
            } else {
                r = m;
            }
        }
        stack[l] = a[i];
    }
    return stack.length;
}

