"use strict";

//  Core logic function
export function solve(n, a) {
    const dp1 = Array.from({ length: n + 2 }, () => Array(n + 2).fill(0));
    const dp2 = Array.from({ length: n + 2 }, () => Array(n + 2).fill(0));

    // Precompute dp1 and dp2
    for (let i = 1; i <= n; i++) {
        for (let j = 1; j <= n; j++) {
            dp1[i][j] = dp1[i][j - 1] + (a[j - 1] < a[i - 1] ? 1 : 0);
            dp2[i][j] = dp2[i][j - 1] + (a[j - 1] > a[i - 1] ? 1 : 0);
        }
    }

    //  Fix: Compute total inversion count correctly
    let sm = 0;
    for (let i = 0; i < n; i++) {
        for (let j = i + 1; j < n; j++) {
            if (a[i] > a[j]) sm++;
        }
    }

    let mx = Number.MAX_SAFE_INTEGER;
    let cnt = 0;

    for (let i = 1; i <= n; i++) {
        for (let j = i + 1; j <= n; j++) {
            const p =
                sm +
                (dp1[j][j - 1] - dp1[j][i]) -
                (dp2[j][j] - dp2[j][i]) -
                1 -
                (dp1[i][j - 1] - dp1[i][i]) +
                (dp2[i][j] - dp2[i][i]);

            if (p === mx) cnt++;
            else if (p < mx) {
                mx = p;
                cnt = 1;
            }
        }
    }

    return [mx, cnt];
}

