// Functional logic
export function solve(n, k) {
    if (k % 2 === 0 || k > 2 * n - 1) return -1;

    const a = Array.from({ length: n + 2 }, (_, i) => i); // 1-based indexing
    k--;

    function mg(l, r) {
        if (k === 0 || l === r - 1) return;
        k -= 2;
        const mid = Math.floor((l + r) / 2);
        [a[mid], a[mid - 1]] = [a[mid - 1], a[mid]];
        mg(l, mid);
        mg(mid, r);
    }

    mg(1, n + 1);
    return a.slice(1, n + 1);
}

