// Core logic function
export function solve(n, s) {
    let running = [0];
    let power = 0;

    for (let i = 0; i < n; i++) {
        if (s[i] !== 0) {
            running.push(s[i]);
        } else {
            if (running.length < 1) {
                continue;
            }
            running.sort((a, b) => a - b);
            power += running.pop();
        }
    }

    return power;
}

