// Core function
// n = length of array, queries = array of query indices (1-based)
export function solve(n, arr, queries) {
    const temp = new Array(n);
    const set = new Set();

    for (let i = n - 1; i >= 0; i--) {
        set.add(arr[i]);
        temp[i] = set.size;
    }

    // For each query, return the value from temp at (index - 1)
    return queries.map(q => temp[q - 1]);
}

